export const resumeUpdater = (
  resume,
  setResume,
  page,
  key,
  value,
  internal_key = null
) => {
  const UpdateData = (page, internal_key, key, value) => {
    console.log("key", key);
    console.log("value", value);
    console.log("resume", resume[page][internal_key]);
    if (!resume[page][internal_key]) {
      resume[page].push({});
    }
    resume[page][internal_key][key] = value;
    return resume[page];
  };

  if (page === "about" && !internal_key) {
    setResume({
      ...resume,
      [page]: {
        ...resume[page],
        [key]: value,
      },
    });
  } else {
    setResume({
      ...resume,
      [page]: UpdateData(page, internal_key, key, value),
    });
    console.log("the resume", resume);
  }
};
